import React from 'react';
import { Link } from 'react-router';

const Header = () => {
    return (
        <div className="header">
            <header>
                <h1>Verse of the Sun</h1>
            </header>
            <nav>
                <Link to="/" style={{ 
                    padding: '0 12px', 
                    backgroundColor: '#000', 
                    borderLeft: '1px solid #fff', 
                    borderRight: '1px solid #fff', 
                    borderRadius: '8px' 
                }}>Home</Link>
                <Link to="/stories" style={{ 
                    padding: '0 12px', 
                    backgroundColor: '#000', 
                    borderLeft: '1px solid #fff', 
                    borderRight: '1px solid #fff', 
                    borderRadius: '8px' 
                }}>Stories</Link>
                <Link to="/games" style={{ 
                    padding: '0 12px', 
                    backgroundColor: '#000', 
                    borderLeft: '1px solid #fff', 
                    borderRight: '1px solid #fff', 
                    borderRadius: '8px' 
                }}>Games</Link>
            </nav>
        </div>
    );
};

export default Header;
